"""![image.png](data:image/png;base64,)"""

style_conv1 = cnn[0]
style_conv2 = cnn[1:4]
style_conv3 = cnn[4:7]
style_conv4 = cnn[7:9]
style_conv5 = cnn[9:12]
content_conv = cnn[0:9]
style_convlist = [style_conv1, style_conv2, style_conv3, style_conv4, style_conv5]

def mse_loss(input, target):
    loss = torch.mean((input - target)**2)     
    return loss

def gram_matrix(feature_map):
    b, c, h, w = feature_map.shape
    gram = torch.mm(feature_map.view(c, h*w), feature_map.view(c, h*w).t())        
    return gram

def compute_content_loss(input, target, content_conv):
    ## Compute the mse-based content loss using content_conv
    input = content_conv(input)
    target = content_conv(target)
    content_loss = mse_loss(input, target)        
    return content_loss

def compute_style_loss(input, target, style_convlist):
     ## Compute the mse-based style loss using gram_matrix and style_convlist
    style_loss = 0
    b, c, h, w = target.shape
    for layer in style_convlist:
      input = layer(input)
      target = layer(target)
      input_gram = gram_matrix(input)
      target_gram = gram_matrix(target)        
      layer_style_loss = mse_loss(input_gram, target_gram)
      style_loss += layer_style_loss / (c*h*w)    
    return style_loss

